### 💻 Code

<!-- Please post the relevant code sample here as well-->
```ts

type DistinctType = DistinctColorType | DistinctNonColorType

type DistinctColorType = {
  key: string extends 'color' ? 'color' : never // alternatively `'color'`
  options: ColorOptions
}

type DistinctNonColorType = {
  key: string extends 'color' ? never : string // alternatively `Exclude<string, 'color'>`
  options: Options
}

type Options = {
  label: string;
}

type ColorOptions = Options & {
  hex: string;
}
// ===================
// usage of types below
// ===================

const nonColorExample: DistinctType = {
  key: 'size', 
  options: {
    hex: 'ffffff', // <<< ERROR
    label: 'else'
  }
}

const colorExample: DistinctType = {
  key: 'color', 
  options: {
    hex: 'ffffff', // <<< If I remove this, there is no error
    label: 'else'
  }
}

```

### 🙁 Actual behavior

when `colorExample.options.hex` is removed, the typechecker doesn't recognize that it's missing

### 🙂 Expected behavior

When `colorExample.options.hex` is removed, the typechecker should recognize that the property is required, because the `key === 'color'`

